CREATE TABLE capitals (
    id integer NOT NULL,
    name character varying(256),
    country_id integer,
    geom geometry(Point,4326)
);

CREATE TABLE countries (
    id integer NOT NULL,
    name character varying(256),
    geom geometry(MultiPolygon,4326)
);

